import React from 'react'

export default function Message(props) {
  return (
    <div className='message'>
         <img src={props.image}></img>
        <div className=''>
                <h1>''</h1>
                <p>{props.text}</p>
                <h1>{props.name}</h1>
        </div>
    </div>
  )
}
